サイズ　：　145cm × 73cm<BR>
素材　　：　ポリエステル 100％<BR>
製造国　：　日本<BR>
<br>
◆まるで宇宙が広がっているかのような星柄がとっても可愛い遮光生地を使用したカフェカーテン。裏地もブルーで綺麗なカラーです。<br>
◆濃淡のあるブルーに上品なゴールドラメで描かれた星がキラキラして見えます。<br>
◆遮光生地を使用しておりますので、外光をしっかり遮り、快適な空間を演出します。<br>
また、小窓以外にも棚などにも使用出来、お気に入りのコレクションなどの日焼け防止としてもオススメです。<br>
